import React from 'react';
import { 
    Timeline, 
    TimelineItem, 
    TimelineSeparator, 
    TimelineDot, 
    TimelineConnector, 
    TimelineContent 
  } from '@mui/lab';

  // import TimelineOppositeContent, {
  //   timelineOppositeContentClasses,
  // } from '@mui/lab/TimelineOppositeContent';

  import { timelineContentClasses } from '@mui/lab/TimelineContent';
  import TimelineOppositeContent from '@mui/lab/TimelineOppositeContent';

  import Chip from '@mui/material/Chip';
  import Stack from '@mui/material/Stack';


const Experience = () => {
  return (
    <div>
      <Timeline>
        <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            June 2023 - August 2023
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>Math and English Tutor @ Kumon</h4>
            <p>• Tutored students of all ages in Math and English through personalized teaching methods to increase comprehension
            of skills</p>
            <p>• Maintained accurate records and performed timely data entry of student grades into the gradebook system
            </p>
            <Stack direction="row" spacing={1} sx={{ mt: 2 }}>
            <Chip label="Data Entry" />
            <Chip label="Mentorship" />
            <Chip label="Communication" />
          </Stack>
          </TimelineContent>
        </TimelineItem>
      </Timeline>
      


      <Timeline>
      <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            February 2024 - Present
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>Graph Visualizations Frontend Developer @ Caesar Research Group PeopleWeave Project</h4>
            <p>• Developing an interactive graph visualization to connect researchers, improve networking experiences, and display
research collaborations using React.js and D3.js
            </p>
            <p>• Collaborating with Graph Visualizations Team to enhance frontend features under Professor Matthew Caesar
            </p>
            <Stack direction="row" spacing={1} sx={{ mt: 2 }}>
            <Chip label="React.js" />
            <Chip label="Figma" />
            <Chip label="Graph Visualization" />
            <Chip label="Data Visualization" />
          </Stack>
          </TimelineContent>
        </TimelineItem>
        <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            February 2024 - Present
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>Design Consultant @ Illinois Design Consulting</h4>
            <p>• Designing UI/UX for cybersecurity platform startup Provenance Security using Miro and Figma to create intuitive
            and cohesive interfaces
            </p>
            <p>• Communicating with client to understand user needs and business objectives
            </p>
            <Stack direction="row" spacing={1} sx={{ mt: 2 }}>
            <Chip label="React.js" />
            <Chip label="Figma" />
            <Chip label="Graph Visualization" />
            <Chip label="Data Visualization" />
          </Stack>
          </TimelineContent>
        </TimelineItem>
        <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            August 2023 - Present
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>App Developer @ Society of Women Engineers (SWE) </h4>
            <p>• Creating an app for John Deere that helps detect and differentiate objects, crops, and animals for farming
technology using React.js
            </p>
          </TimelineContent>
        </TimelineItem>

        <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            February 2023 - Present
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>Marketing Chair @ Reflections Projections Tech Conference </h4>
            <p>• Brainstorming and executing innovative marketing strategies, such as unique social media campaigns and
on-campus promotions, to increase attendance for an annual tech conference at UIUC
            </p>
            <p>• Conducting and planning weekly meetings to communicate timelines and delegate tasks</p>
            <p>• Successfully attracted over 2,000 registrations for the event last year
            </p>
          </TimelineContent>
        </TimelineItem>
        <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            August 2022 - May 2024
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>Recruitment Committee Chair @ Society of Women Engineers </h4>
            <p>• Planning weekly committee meetings by planning detailed meeting agendas and bonding events
            </p>
            <p>• Organizing recruitment events for STEM majors on campus by collaborating with other organizations to enhance
outreach</p>
          </TimelineContent>
        </TimelineItem>
      </Timeline>

      
    </div>
  );
};

export default Experience;



